{ entry = 121374,  name = "Several layers of the same landmass appear to be stacked on top of one another, with scores of thin lines weaving all throughout." },
{ entry = 121375,  name = "No one is sure how this juiced anything." },
{ entry = 121376,  name = "Traces of an intricate etching in the sword's blade remain despite thousands of years of disuse." },
{ entry = 121377,  name = "A very large bear appears to have taken a bite out of this." },
{ entry = 121378,  name = "Too long disused to hold tension, this bow was carved with great care and depicts the deeds of an ancient elven hero." },
{ entry = 121379,  name = "Smaller than the average musket, and engraved with the initials 'A.F'." },
{ entry = 121380,  name = "Discarded after its previous owner memorized its unique appearance." },
{ entry = 121381,  name = "It unfortunately has no sockets." },
{ entry = 121382,  name = "This enormous weapon is almost entirely the leg chitin of what must have been a huge insectoid creature, counterweighted with engraved stones." },
{ entry = 121383,  name = "" },
{ entry = 121384,  name = "Claimed by an unknown victor from the remnants of a powerful water elemental." },
{ entry = 121385,  name = "All you can discern from the faded cards are images of trees with arms and small green humanoids." },
{ entry = 121386,  name = "This primitive belt is a collection of preserved insectoid jaws the size of a man's forearm, and is completely impractical as attire." },
{ entry = 121387,  name = "Extra pockets contain gold and dice." },
{ entry = 121388,  name = "These bindings mark the hopeless struggle of the paladin Elund." },
{ entry = 121389,  name = "More resembling obsidian stone than a gem, a feeling of unsettling dread nags at your thoughts as you hold this in your hands." },
{ entry = 121390,  name = "Korl won't admit that Anund was trying to heal himself through Kaldrigos's arcane breath with these." },
{ entry = 121391,  name = "Covered with foul liquid and shards of glass." },
{ entry = 121392,  name = "Dozens of hidden pockets line these torn pants, each perfectly sized for a throwing dagger." },
{ entry = 121393,  name = "Once belonged to a legend that has since fallen from grace." },
{ entry = 121394,  name = "Let me just swap around a few items and trinkets... Alright! Ready in 25.. 24.. 23.. 22... 21.." },
{ entry = 121395,  name = "May greatly improve performance in challenging dungeons." },
{ entry = 121396,  name = "These shoulderguards are ancient even by Azsharan standards and are etched with loa-sigils." },
{ entry = 121397,  name = "Why would someone want such heavy shoulderpads?" },
{ entry = 121398,  name = "Mother Shahraz gave these to the ones that didn't quite make the cut." },
{ entry = 121399,  name = "These surely caused much inaccuracy." },
{ entry = 121400,  name = "Xalan's gloves looked better on her than on him." },
{ entry = 121401,  name = "A man who lives everywhere lives nowhere." },
{ entry = 121402,  name = "May have belonged to a butcher some time ago." },
{ entry = 121403,  name = "Some tufts of hair are melted to the sides." },
{ entry = 121404,  name = "Inferior production methods robbed this helm of much of its potential power." },
{ entry = 121405,  name = "Someone became very angry while wearing this." },
{ entry = 121406,  name = "Worn down from repeated use." },
{ entry = 121407,  name = "These could easily launch you a great distance if refilled, if not for the components which exploded in the previous attempt." },
{ entry = 121408,  name = "This was very valuable to someone once." },
{ entry = 121409,  name = "Adorning this armor is the remains of a once-vivid painting of a battle between tusked humanoids and giant, faceless creatures." },
{ entry = 121410,  name = "The markings on this robe resemble both the sign of Elune and several venerated Loa spirits." },
{ entry = 121411,  name = "Smells like a wet cat. And a wet bear. And a wet moonkin." },
{ entry = 121412,  name = "Someone discovered they could walk faster without these, through other means." },
{ entry = 121413,  name = "These boots are split down the middle at the toes, creating what were undoubtedly two very large and painful-looking spikes before centuries of decay left them dull and brittle." },
{ entry = 121414,  name = "The only time he was counterspelled was when he wore these boots." },
{ entry = 121415,  name = "You'd think a warlock would have known that he couldn't wear these." },
