{ entry = 128820,  name = "...not elven weapons. Not when they are reforged with magic, and hatred, and a burning need for revenge. No, Arthas. Felo'melorn is stronger than ever-as am I. - Kael'thas Sunstrider" },
{ entry = 128821,  name = "Ursoc, brother of Ursol and guardian of the furbolg tribes... bearer of the strength of the forest itself." },
{ entry = 128822,  name = "Azeroth will need you. If you do not stand ready, the world may fall." },
{ entry = 128823,  name = "Tyr replied that he did not consider his argent hand a reminder of defeat. For him it was a symbol of the sacrifice he had made to defend Azeroth, and he wanted the world to see it that way as well." },
