{ entry = 128826,  name = "When it was retrieved from the Sunwell, the bow radiated power. Talanas was humbled by the gift. He named the weapon Thas'dorah, " },
{ entry = 128827,  name = "Xal'atath has a mind of its own. Ignore its maddening whispers. Do not trust the lies it spins. Take from it what you need, but always remember that the dark presence in the blade is not your ally." },
{ entry = 128831,  name = "His warblades howled over the clamor of battle, rending anything that came near. Each demon Toranaar vanquished seemed to fill him with renewed vigor and strength. He was an army unto himself." },
{ entry = 128832,  name = "The Aldrachi were a proud race. Too proud to serve. Millions of demons died before the Aldrachi were wiped out, and it took Sargeras himself to kill their king." },
