{ entry = 128858,  name = "There is power within that would be freed. With balance and control, the wolf may be tamed, but only for a time." },
{ entry = 128859,  name = "She ripped through the demons' ranks and then disappeared into the trees. She crept along the high branches and dove down upon the Legion commanders. She was a terror, a fearsome beast, and she held nothing back, offering no mercy." },
{ entry = 128860,  name = "The sacrifice of Ashamane is remembered to this day. We live by her grace, and her children still tread the forests with us as our closest companions." },
{ entry = 128861,  name = "A peerless example of techno-magical engineering, infused with the power of storms." },
{ entry = 128862,  name = "Ebonchill contained only a sliver of Alodi's might, but even that was more than most magi could ever hope of wielding." },
{ entry = 128864,  name = "Goat saliva has caused the ink to run and blur." },
{ entry = 128866,  name = "With the first hammer fall, rivers of magma spilled from the icy mountains. With the second, the sky howled and lightning set the heavens aflame. With the third, a single ray of sunlight pierced the storm clouds and whispered over Truthguard's surface." },
{ entry = 128867,  name = "Killing for the sake of killing... conquering for the sake of conquest... there is no honor in such things. There is only shame and regret." },
{ entry = 128868,  name = "It was with our greatest hopes and prayers that we attended the ceremony that day... and it is with our greatest sorrows that we departed it." },
{ entry = 128869,  name = "It was not a pleasant death. But it was fast, quiet, and efficient. When the orc took his last breath, the wound that killed him became irregular. Nobody would be able to tell whether he had died to a knife, an axe, or a spear." },
{ entry = 128870,  name = "Countless voices hushed, and countless leaders toppled... all at the whim of his foul command. There would be no redemption for these acts, only solitude and sorrow." },
{ entry = 128872,  name = "She saw herself commanding an impossibly large pirate fleet, one that could conquer the high seas and all the nations of Azeroth. Every ship that dared to challenge her burned, and every city gave up its treasures or was destroyed." },
{ entry = 128873,  name = "Created through the power of Doomhammer and the powerful shaman who wields it." },
