{ entry = 128908,  name = "Helya's betrayal shall never be forgiven. Let her rot beneath the waves, far from the Halls of Valor." },
{ entry = 128910,  name = "The steel of the barbarian king shall strike the final blow. It shall silence the din of battle, and bring the first kingdom into an age of peace." },
{ entry = 128911,  name = "They drifted into the abyss, but Azshara and her Highborne remained unbroken. The darkness around them was absolute, and so the queen willed Sharas'dal to bring them light..." },
