{ entry = 128921,  name = "The accumulated sludge of a city of mages." },
{ entry = 128922,  name = "Known more colloquially among alchemists as " },
{ entry = 128923,  name = "Specially formulated to insulate against both heat and ley energy." },
{ entry = 128924,  name = "More mechanical than magical. Perhaps this came from the engineering shop?" },
{ entry = 128933,  name = "The amber eye has a soft, warm glow that invites a closer look." },
{ entry = 128934,  name = "As the ocean crushed the life from their bodies, ancient creatures stirred in the darkness. Their whispers flowed through the currents. Their powers wrapped tight around the queen and her servants." },
{ entry = 128935,  name = "To seal Al'Akir's demise, Master Ra slammed his fist into the mountaintop. The heavens split wide, and all the fire and fury they contained crashed down atop the Windlord's head." },
{ entry = 128936,  name = "Ra and Helya crafted a shield, the Highkeeper's Ward, to act as a key to the Elemental Plane. It thrummed with the energies of the four elements, which Ra could call upon whenever he desired." },
{ entry = 128937,  name = "You seek the calm, inevitable force of a deep river, the kind that carves canyons into the toughest stone and carries away warriors on its currents without so much as a ripple. Sheilun is the embodiment of that idea." },
{ entry = 128938,  name = "From the beginning, this staff has accompanied legendary creatures and immortal spirits as they carried out important, lasting work all across Azeroth." },
{ entry = 128940,  name = "When Irmaat hefted his two weapons and tested the power within them, uncontrollable fury spilled forth." },

{ entry = 128942,  name = "The scythe's master will either overcome Sataiel or be consumed, which will only make the blade more powerful. And then another bearer will take their place. And another." },
{ entry = 128943,  name = "When finally Thal'kiel emerged, he was changed. He had aged by centuries, alone in the dark with his thoughts and his thralls. His back was twisted and stooped, and there was an odd glimmer in his eye. He summoned his Wakeners, and we answered the call..." },
