{ entry = 132357,  name = "Corrupted by the demonlord Sargeras, Medivh contacted the orc warlock Gul'dan and together they opened the Dark Portal, allowing the Burning Legion to begin its invasion of Azeroth." },
{ entry = 132359,  name = "The Subjugator's Shackles" },
{ entry = 132360,  name = "Petrified Arkhana" },
{ entry = 132361,  name = "Petrified Arkhana" },
{ entry = 132365,  name = "For his misdeeds, Bryndaor was charged with guarding the gates of Helheim for eternity." },
{ entry = 132366,  name = "Following the Battle for Light's Hope Chapel, the two comrades parted ways. Thassarian opted to serve his king, while Koltira, former defender of Quel'Thalas, chose to join his people, the blood elves." },
{ entry = 132367,  name = "After his demise, Gorefiend returned as the first death knight and swore allegiance to Orgrim Doomhammer." },
{ entry = 132368,  name = "A broken piece of the Band of Farondis." },
{ entry = 132369,  name = "Left at home on a crucial day during the Argent Tournament." },
{ entry = 132370,  name = "A crude ring, suitable for murloc nostrils, lips, and fins." },
{ entry = 132374,  name = "As the Doom Lord crossed through the Dark Portal to Outland, he left his enemies with a parting gift..." },
{ entry = 132375,  name = "Found pristine under burnt rubble in the village of Ymirheim." },
{ entry = 132376,  name = "For you do not face me alone, but the host of the Ebon Blade itself. We are undying, we are unceasing, and we hunger for life!" },
{ entry = 132377,  name = "A battered old compass with ties to the Dark Riders of Deadwind Pass." },
{ entry = 132378,  name = "Misery... confusion... mistrust. These are the hallmarks." },
{ entry = 132379,  name = "So many of our people have been twisted and dominated by the Burning Legion. It's only fitting that we in turn use their own armies against them." },
{ entry = 132381,  name = "The only risk is that you'll go insane." },
{ entry = 132393,  name = "It was always a wonder to outsiders how certain Vrykul warlocks managed to summon and command enormous packs of felstalkers." },
{ entry = 132394,  name = "Whoever dons this hood gains unholy strength and resolve, but will forever lose all kindness and compassion. Beware..." },
{ entry = 132406,  name = "Contrary to popular belief, Kael'thas's favored, and usually final, utterance to his enemies was actually 'PYROBLAST!'." },
{ entry = 132407,  name = "Varo'then was madly in love with the queen. Unfortunately, he never had the opportunity to use these restraints on her." },
{ entry = 132409,  name = "Why Anund was standing in front of Kaldrigos is anyone's guess. However, legend has it that Anund's final Shadow Word: Pain was key in helping Korl defeat the dread wyrm." },
{ entry = 132410,  name = "The draenei capital city is able to transcend dimensions and even warp time itself. What could a sliver of its power do in the hands of a mere mortal?" },
{ entry = 132411,  name = "Imbued with the power of the naga sea witch, your fingers inside feel frigid but surprisingly limber and highly energized." },
{ entry = 132413,  name = "Mages who wield as much power as Rhonin, a former leader of the Kirin Tor, often use arcane bindings to steady the magic unleashing from their fingertips." },
{ entry = 132436,  name = "Ivagont fought at Kakushan's side, as he always does, during their massacre of the Stormscale naga in Darkshore. By virtue of his protection, they left unscathed." },
{ entry = 132437,  name = "You seem a little tense..." },
{ entry = 132438,  name = "(NYI - Requires Revered with Valkyra) Given to Valkyra who have proven themselves ready to ascend to the highest ranks of their order." },
{ entry = 132440,  name = "Greatshield of Odyn, lord of the Halls of Valor." },
{ entry = 132441,  name = "Legend holds that the bodies of the titanspawn are so saturated with the energy of the creators that they leave behind fragments when the mortal host dies. This girdle is said to have been painstakingly sewn together from those fragments." },
{ entry = 132442,  name = "The magic contained inside seems to be as endless as the Burning Legion." },
{ entry = 132443,  name = "Time and space are one. To a watcher of the universe, distance is nearly meaningless." },
{ entry = 132444,  name = "Bearers of this amulet whistle a haunting tune, and those nearby attest to a distant cry of anguish between the notes." },
{ entry = 132445,  name = "It is said that this once belonged to the original Val'kyr." },
{ entry = 132446,  name = "A large sack containing various jewels." },
{ entry = 132447,  name = "Bearers of these trousers often go above and beyond the call of duty." },
{ entry = 132448,  name = "Thought to be given by Razuvious to his most gifted acolytes, it is unclear how this band escaped the walls of Naxxramas. Could the Lich King have sent his own agents to the Broken Isles?" },
{ entry = 132449,  name = "Phyrix was a legendary priest who led adventurers through Molten Core and Blackwing Lair. She met an unfortunate demise at the hands of Nefarian, but her spirit still protects Azeroth's champions to this day." },
{ entry = 132450,  name = "From their humble beginnings in Silvermoon to the depths of Blackrock Mountain, Muze always remained steadfast, faithfully healing her companions and saving them from the brinks of death." },
{ entry = 132451,  name = "While Northrend's half-giants naturally know little to no magic, the mystic vrykul of Stormheim are masters of rune magic." },
{ entry = 132452,  name = "Intangibility is a curious concept. The word suggests some magical ability, but in the physical world, it simply means the power to be here or there, now or later." },
{ entry = 132453,  name = "Parts of the shambling horror Rattlegore still contain potent necromantic energies that respond to the will of those strong enough to command them." },
{ entry = 132454,  name = "Deep within the vault protected by Wintergrasp, Koralon the Flame Watcher was furious when intruders entered." },
{ entry = 132455,  name = "Magic must be regulated, managed, and controlled. But it must also be appreciated and valued, not hoarded. Such is the paradox that you must comprehend." },
{ entry = 132456,  name = "Viewed from different angles, there seems to be faint reflection of three different faces." },
{ entry = 132457,  name = "Lethtendris constructed a device to siphon Dire Maul's overwhelming corrupt power for herself." },
{ entry = 132458,  name = "Deep within the vault protected by Wintergrasp, Toravon the Ice Watcher was relentless in smashing interlopers." },
{ entry = 132459,  name = "Cold steel rests heavily on the brow of this crown's bearer." },
{ entry = 132460,  name = "Depravity... hatred... chaos. These are the pillars." },
{ entry = 132461,  name = "Ripped from Xalan's hands by night elves during the War of the Satyr." },
{ entry = 132462,  name = "Enough meat for the bellies of a thousand warriors." },
{ entry = 132463,  name = "Mature basilisk spines can be used to make broth for vast quantities of stew." },
{ entry = 132464,  name = "Ley-infused boar meat is said to grow one-hundred fold in size when cooked." },
{ entry = 132466,  name = "The ties of the earth are deep, consistent, and rarely waver." },
