{ entry = 136339,  name = "Spellstone of Kel'danath" },
{ entry = 136342,  name = "This material seems to have lost all its power." },
{ entry = 136343,  name = "Cracked and beaten, these hooves tell a story." },
{ entry = 136350,  name = "This ancient vrykul hammer may be used in lieu of a normal blacksmith hammer for crafting." },
{ entry = 136351,  name = "Handful of Obliterum Ash" },
{ entry = 136352,  name = "Archmage Karlain's Imbued Silkweave Robe" },
{ entry = 136353,  name = "Useless... you might find someone willing to buy it for scrap." },
{ entry = 136354,  name = "Whatever this used to be is no longer recognizable and certainly not magical." },
{ entry = 136355,  name = "Whatever used to be written on this, it is barely legible. You might find someone willing to buy it for firewood." },
{ entry = 136356,  name = "An extensive recounting of many of the great weapons that have played a role in Azeroth's history." },
{ entry = 136357,  name = "Crafted with ingredients native to Val'sharah, one would hope that this tonic tastes better than it smells." },
{ entry = 136358,  name = "These offerings are fashioned from a bear tooth adorned with malachite chips." },
{ entry = 136359,  name = "Let's see what the Shaman had on them..." },
{ entry = 136360,  name = "Crystalline Demonic Eye" },
{ entry = 136361,  name = "Pieces of armor from a battle long ago." },
{ entry = 136362,  name = "Stormheim was host to many brutal battles during the War of the Ancients." },
{ entry = 136363,  name = "Scrawled in haste, the script is barely legible." },
{ entry = 136369,  name = "Even dead, this scale crackles with electricity." },
{ entry = 136370,  name = "Little of this skull resembles its original shape." },
{ entry = 136371,  name = "This is the finest drake skull you have seen yet." },
{ entry = 136372,  name = "Archaeologist's Whistle" },
{ entry = 136373,  name = "Can O' Worms Bobber" },
{ entry = 136374,  name = "Toy Cat Head Bobber" },
{ entry = 136375,  name = "Squeaky Duck Bobber" },
{ entry = 136376,  name = "Murloc Bobber" },
{ entry = 136377,  name = "Oversized Bobber" },
{ entry = 136381,  name = "The key's edge has worn off, but the head is still ornamented with valuable metals and gemstones." },
{ entry = 136382,  name = "Various documents outlining the holdings of the Ravencrest family." },
{ entry = 136383,  name = "Marked with an insignia of a raven." },
{ entry = 136385,  name = "You can hear a faint scream coming from deep within." },
{ entry = 136386,  name = "Brilliant in color and warm to the touch." },
{ entry = 136389,  name = "An ancient text detailing the production of Infernals." },
{ entry = 136391,  name = "Dark energy glows crimson within." },
{ entry = 136394,  name = "A powerful troop which can accompany followers on missions to increase success chance." },
{ entry = 136397,  name = "One small section of a much larger titan disc." },
{ entry = 136398,  name = "The vial itself is cracked and dusty, but the fluid inside still glows brightly." },
{ entry = 136400,  name = "A shadowy shard of ice carried by a follower of the Darkness." },
