{ entry = 137021,  name = "I've been preparing for you, young prince. I am Mal'Ganis. As you can see, your people are now mine..." },
{ entry = 137054,  name = "Midst the third war, when the walls of Kalimdor defenders fell, Shaka, the Ancient of War, refused." },
{ entry = 137022,  name = "These boots are the only thing that remained after the Stone Knife of Sealing trapped Rakh'likh within Loramus the Defiled's body." },
{ entry = 137023,  name = "When others receive life and energy from you, you too shall receive life and energy from me." },
{ entry = 137024,  name = "The madness within Marl Wormthorn is said to have empowered these boots." },
{ entry = 137025,  name = "During the Battle for Mount Hyjal, Skysec, guardian of Nordrassil, endured endless waves of scourge and legion. In the end, he proudly gave his life in defense of the ancient world tree." },
{ entry = 137026,  name = "Feel nature flowing through your veins." },
{ entry = 137027,  name = "'Brother Adam and Brother David were brilliant mathematicians and monks, always blabbing about abacuses and parabolas.' -Brynild the Brewmaster" },
{ entry = 137028,  name = "Eramas Brightblaze always remarked how comfortable these were." },
{ entry = 137029,  name = "Said Kaulder to his brother Katsuo: 'With training, your reactions can become faster and your fists can become more furious than any foe can handle.'" },
{ entry = 137319,  name = "Paranoid Sprinters" },
{ entry = 137030,  name = "If an SI:7 agent like Caelvana has you in her sights, you'd better run. You better run far, and you better do it quickly." },
{ entry = 137031,  name = "Thraxi often disguised herself as a brewmaster monk to deceive her enemies." },
{ entry = 137032,  name = "While the exact origins of the Shadow satyr are unidentified, they are known to be incorporeal creatures that not only exist inside the Emerald Nightmare but in places on Azeroth as well." },
{ entry = 137033,  name = "They provided the huntress with a feeling of weightlessness- a calm and serenity amid the storm." },
{ entry = 137034,  name = "Something with very large teeth tried taking a bite out of these boots." },
{ entry = 137035,  name = "Ner'zhul, Elder Shaman of the Shadowmoon Clan, wanted to save his people and finally obtain the power and respect he so dearly desired. But he was deceived..." },
{ entry = 137036,  name = "Originally used by a powerful doomguard to rain down fiery death, these were repurposed for a more benevolent cause in order to balance out the destruction they had previously caused." },
{ entry = 137037,  name = "The corrupting power of the Nightwell flows through this ring, allowing the wielder to siphon power from those under their command." },
{ entry = 137038,  name = "Those oversized Vrykul are not the first thing you want to run into in Northrend. Try the undead of Borean Tundra instead." },
{ entry = 137039,  name = "The druids of the Emerald Circle manipulated the fel energy within this stone to enhance their attunement with the wild." },
{ entry = 137040,  name = "The fire within Leyara enchants this signet. You can feel that she has finally found peace." },
{ entry = 137041,  name = "Druids of the Claw have the ability to transform, becoming either faster or tougher. They typically choose the latter." },
{ entry = 137042,  name = "The myth surrounding Elune, one of the few true deities of Azeroth, suggest her true identity might not yet have been fully understood." },
{ entry = 137043,  name = "Apply a little butter and it comes right off!" },
{ entry = 137044,  name = "Originally a gift from the mage, Veri'thas, this trinket was allegedly stolen from the Lost Abbey after a conflict between the monks and the elves." },
{ entry = 137045,  name = "Well... one of his eyes." },
{ entry = 137088,  name = "Legendary fighters always take their opponents head-on." },
{ entry = 137046,  name = "Silvermoon was constructed out of radiant white stone and adorned in crimson tapestry. However, the city's renown was not merely for its beauty. Silvermoon is a seat of magical learning and home to master manipulators of mana." },
{ entry = 137047,  name = "Heathcliff, known as the Immortal Object, was said to be immune to any grave injury. Some questioned whether the Blood Knight's fortitude transcended the natural laws of the world." },
{ entry = 137048,  name = "We were betrayed by the man we called our prince. I pledge the blades of my Blood Knights to the defeat of Kil'jaeden and the restoration of Silvermoon. We will fight beside you, A'dal." },
{ entry = 137049,  name = "An insignia only given to those who have demonstrated mastery of the shadows, and killed in service to Ravenholdt." },
{ entry = 137050,  name = "In the nether, though the elements of the world are twisted and barely recognizable, their power is without equal." },
{ entry = 137051,  name = "Under the training of Jonat Han, new shamans of the Dragonflayer clan mastered the ways of the waters - healing the one and the many." },
{ entry = 137052,  name = "In the pits of Valhalas, Ayala the Relentless cut down foe after foe on his way to legend. Becoming more lethal as his opponents weakened, he was truly terrifying to spectate." },
{ entry = 137053,  name = "Jinyu whisper tales of the great warrior, Fujieda, who slew a mighty fel demon after lying in wait in a shallow pool for hours." },
{ entry = 137055,  name = "Its power was extracted from hunters who were sacrificed in Dire Maul." },
{ entry = 137056,  name = "Nothing works quite like a good luffa." },
{ entry = 137057,  name = "For thousands of years, ancient understandings of lifeflow manipulation have been passed in secret from one master to another." },
{ entry = 137058,  name = "Working together to defeat Azeroth's greatest enemies, the best minds congregated in a forum dedicated to intellectual discussion and war strategy while their champions battled on the frontlines." },
{ entry = 137059,  name = "After losing his hand to the massive proto-dragon Galakrond, Jotun forged Tyr a new one." },
{ entry = 137060,  name = "Deep within the vault protected by Wintergrasp, Archavon the Stone Watcher was hateful of all trespassers." },
{ entry = 137061,  name = "As the world... goes by... we'll go on forever." },
{ entry = 137062,  name = "Ysera dreams and the world trembles." },
{ entry = 137063,  name = "Sit back, relax, and observe the world around you." },
{ entry = 137064,  name = "'If dey want to kill me, dey betta' kill me da first time. Dey betta' kill me dead. Dey betta' kill me when I'm in my sleep.' -Vol'jin, after surviving Garrosh's assassination attempt." },
{ entry = 137065,  name = "This helm was once worn by Highlord Alexandros Mograine, and had things gone differently, would have been passed on to his sons, Renault and Darion Mograine." },
{ entry = 137066,  name = "Appearing like any other found in the molten depths, this one appears to burn with a greater purpose." },
{ entry = 137067,  name = "'100% all natural fury' was an apt description of its owner during the Sundering." },
{ entry = 137068,  name = "The Black Flame specializes in providing the finest services and entertainment money can buy, whether they happen to be hard to find items, gladiatorial combat, or lucrative games of chance." },
{ entry = 137069,  name = "At a young age, Valeera survived the death of her parents, imprisonment, and slavery. Her enemies have always underestimated her will to survive." },
{ entry = 137070,  name = "Power comes from strength, and true strength comes from strong legs bolting you to the ground." },
{ entry = 137071,  name = "Molgeim of the Assembly of Iron mastered the use of runes for a myriad of devastating effects." },
{ entry = 137072,  name = "Unto you is charged the great task of keeping the purity of time. Know that there is only one true timeline, though there are those who would have it otherwise. You must protect it." },
{ entry = 137073,  name = "Every place you've ever imagined- it is real. It is a fictional city in your mind and you know every corner of it. Your mind is a world. Each of us is a place." },
{ entry = 137074,  name = "10,000 years ago, the Well of Eternity imploded. The effects are still felt today." },
{ entry = 137075,  name = "During the first invasion of Azeroth, legion commander Tak'theritrix was key in peeling apart the initial night elf defense." },
{ entry = 137076,  name = "These appear to emanate the same power as the dark portal." },
{ entry = 137077,  name = "All living creatures trust in the stillness of the earth. They know nothing of the currents that flow beneath its surface. They do not comprehend its weight. They cannot understand its power." },
{ entry = 137078,  name = "Patience, young one, and you someday will have it all." },
{ entry = 137079,  name = "Gai Plin extracted the healing powers of the Ru'shan River to infuse this belt with its soothing sensations." },
{ entry = 137080,  name = "Woven from the manes of the fabled Seven Lions, this belt was crafted by the night elf sentinel Tyven." },
{ entry = 137081,  name = "Sentinels are the expert marksmen and elite fighters among the night elves. Few warriors can match the proud archers' speed and cunning." },
{ entry = 137082,  name = "Ghostly howls hang in the fog long after Helheim has taken another." },
