{ entry = 137084,  name = "His molten powers could shape an entire landscape." },
{ entry = 137085,  name = "The naga of Nazjatar are masters of sorcery and natural dwellers of the ocean deeps. It makes sense that wearing their discarded skin would grant you a greater control over the tides." },
{ entry = 137086,  name = "The prayer of an ancient Valhalas champion resonates through the links: 'If you stand in the light, you will never stand alone.'" },
