{ entry = 138885,  name = "Treasure of the Ages" },
{ entry = 138886,  name = "Favor of Valarjar" },
{ entry = 138892,  name = "May they someday understand why I did what I did." },
{ entry = 138893,  name = "I wish I had some mana right... now! NOW! Now." },
{ entry = 138894,  name = "Please, protect my grandfather." },
{ entry = 138895,  name = "Please, help my granddaughter lighten up a bit." },
{ entry = 138896,  name = "The adventure has been formidable, but I am far from my Moa'ki. I wish to soon see home." },
{ entry = 138897,  name = "What the ookin' jeek? What kind o' mank-dookin' wicket-lover throws away perfectly good coin?!" },
{ entry = 138898,  name = "Golk wish Golk could fit out of this cave." },
{ entry = 138899,  name = "I wish I were a little bit taller." },
{ entry = 138900,  name = "You never sausage a hat!" },
{ entry = 138901,  name = "That I might protect those I hold dear, and continue to reflect the grace and light of Elune." },
{ entry = 138902,  name = "Were we too late to stop the Nightmare?" },
{ entry = 138903,  name = "Perhaps if we curb these endless tides of demons, then some color may return to the world." },
{ entry = 138904,  name = "Give my troops the strength to overcome the trials of this land." },
{ entry = 138905,  name = "I kinda wish I was a worgen. Wouldn't that be the coolest?" },
{ entry = 138906,  name = "I give my thanks to the Cenarion Circle. May the mortal druids continue to prove themselves worthy of my father's name." },
{ entry = 138907,  name = "Hmm... no coins. I wonder if this will suffice?" },
{ entry = 138908,  name = "I suppose I might fancy a smackerel of honey." },
{ entry = 138909,  name = "Some days, I think the murlocs don't appreciate everything I do for them." },
{ entry = 138910,  name = "I wish my son would hurry up and have kids already! Also, I want to shoot a moose." },
{ entry = 138911,  name = "Mrr glrrrgl mrr glrrgl glrr." },
{ entry = 138912,  name = "For all the brothers and sisters I've lost." },
{ entry = 138913,  name = "Ooh, ooh! I hope I get to shoot a really cool gun! BLAM!" },
{ entry = 138914,  name = "Come on, move that shell, Zoom! Just like we practiced!" },
{ entry = 138915,  name = "Me want find candlequeen! Hmm... maybe Jackie interested? Me give her candle, see what happens from there." },
{ entry = 138916,  name = "I hate everything. Everything is horrible." },
{ entry = 138917,  name = "Strength. Glory. Power." },
{ entry = 138918,  name = "A single shared goal does not erase the atrocities committed by the Forsaken." },
{ entry = 138919,  name = "Dark Lady watch over this fountain." },
{ entry = 138920,  name = "If found, please return this coin to me... in person." },
{ entry = 138921,  name = "Good heavens, is this a wishing well?  How quaint." },
{ entry = 138922,  name = "Ughh... this meat is so dry. I wish I had some gravy." },
{ entry = 138923,  name = "Talking to adventurers is so tiring... a few decades of peace is all I ask..." },
{ entry = 138924,  name = "Fooled ya, ya dumb fountain." },
{ entry = 138925,  name = "May the downtrodden one day rise up and take the place of those that would oppress them." },
{ entry = 138926,  name = "I wish to protect my people from the vile outsiders that wish to harm them. Whatever it takes." },
{ entry = 138927,  name = "Oh, to have an apprentice that could keep up with me!" },
{ entry = 138928,  name = "I wish my father were alive, to help guide us through these difficult times." },
{ entry = 138929,  name = "Gloooglrr mrm." },
{ entry = 138930,  name = "Keep your wishes for yourself. I do not negotiate with fountains." },
{ entry = 138931,  name = "I just want all worlds to burn." },
{ entry = 138932,  name = "I want more kitties." },
{ entry = 138933,  name = "Fish do not have souls. This is pointless." },
{ entry = 138934,  name = "Think for yourself." },
{ entry = 138935,  name = "I wish I was stronger." },
{ entry = 138936,  name = "I remember when Suramar was beautiful and tranquil... before Azshara and her Highborne ruined everything. Wishes will buy you nothing except regret." },
{ entry = 138937,  name = "These magi allowed me to land here. While most do nothing but eye you with suspicion and contempt, or worse, some still see past the surface. My wish is for all of us to work together and recognize our true enemy: the Burning Legion." },
{ entry = 138938,  name = "In my previous life, I would have loved to have lived in this floating marvel. I would have spent the days fishing in this magic fountain in-between practicing the arcane arts. Those days are long gone." },
{ entry = 138939,  name = "Strong leadership and a clear vision are the only path to victory." },
{ entry = 138940,  name = "I don't have the luxury of fishing and wishing. There are demons to kill." },
{ entry = 138941,  name = "Gain 1 Mana Crystal this turn only." },
{ entry = 138942,  name = "The wishing module is busy at this time. Please try again later. (Error 37)" },
{ entry = 138943,  name = "May the Light bathe this land in all its glory." },
{ entry = 138944,  name = "What is nature's call? I actually do wish someone would finally tell me what " },
{ entry = 138945,  name = "An end to the Burning Legion." },
{ entry = 138946,  name = "Soon, you will ALL feel my wrath!!!" },
{ entry = 138947,  name = "Yes! This way I can get my wish AND keep my coin. Hah! Oh no, the string broke! Stupid fountain, give me my coin back..." },
{ entry = 138948,  name = "My wish is to never run out of newly-discovered continents to explore." },
{ entry = 138949,  name = "Witness the flames that have consumed countless worlds. All will burn in the legion's fire!" },
{ entry = 138951,  name = "Proof of your command over the element of fire." },
{ entry = 138952,  name = "Proof of your command over the element of air." },
{ entry = 138953,  name = "Proof of your command over the element of water." },
