{ entry = 139549,  name = "A dark weapon from a long dead master, hungering to taste blood again." },
{ entry = 139550,  name = "Once an indomitable construct of the draenei, turned by the Legion into an instrument of destruction, the Iron Warden fell long ago during the taking of the Aldrachi homeworld." },
{ entry = 139551,  name = "A rare flower from the Emerald Dream, not seen in Azeroth since the War of the Ancients." },
{ entry = 139552,  name = "A single feather from a reclusive wild god. With it, a Druid of the Claw could learn to master a previously unseen form." },
{ entry = 139553,  name = "A powerful mark put on wild bears by Ursol to empower them as defenders of the wilds in times of need." },
