{ entry = 139564,  name = "We have sworn to restore hope to this troubled world.  To seek out tyranny and evil wherever they take root... and bring the hammer of justice down upon the wicked." },
{ entry = 139565,  name = "When Exarch Kelios fell, the remaining hope of holding the temple faded away. The Legion had won. The only peace they would find now was in the thought of those few who had escaped, but the Legion would soon take that from them as well." },
