{ entry = 146308,  name = "Deadly against demons!" },
{ entry = 146309,  name = "The desiccated remains of a successful Highborne spellcast." },
{ entry = 146310,  name = "Roils with barely contained fel energy." },
{ entry = 146311,  name = "The blood seethes with anger within the vessel." },
{ entry = 146312,  name = "Faintly glows with fel energy." },
{ entry = 146313,  name = "The blue clay has been painted with roseate pigment." },
{ entry = 146314,  name = "This arrowhead likely belonged to an ancient Highborne sentinel." },
{ entry = 146315,  name = "This boon was not immune from being strewn." },
{ entry = 146316,  name = "This type of coin has not been in circulation in Suramar for at least 7,000 years." },
{ entry = 146317,  name = "Usually contains pet supplies and some pet charms." },
{ entry = 146318,  name = "Nearly indistinguishable from an ogre's fingerbone." },
{ entry = 146319,  name = "A fetid mix of ash and demon's blood." },
{ entry = 146320,  name = "Gems like these were often studded into a high-ranking demon's armor or weapon." },
{ entry = 146321,  name = "A grim silhouette of a long-fallen demon." },
{ entry = 146322,  name = "These ancient demonic rations have been perfectly preserved." },
{ entry = 146323,  name = "Missing its candle." },
{ entry = 146324,  name = "When preserved in a dry enough environment, these feathers become hard like bone." },
{ entry = 146325,  name = "The pouch is full of holes, and the grain is long-gone." },
{ entry = 146326,  name = "The remains of a particularly hot-burning funeral pyre." },
{ entry = 146327,  name = "The forgotten totem of a long-dead tauren shaman." },
